import React from 'react'
import { Container, Row, Col } from 'reactstrap';
import styled from 'styled-components'

const FormLogin = styled.div`
    width : 900px;
    height : 70%;
    background-color : #f8f8f8;
`;

export default function Login() {
    return (
        <>
            <FormLogin >
                Login
            </FormLogin>
        </>
    )
}
